import React, { useState } from "react";
import "./Create.css";
import Swal from "sweetalert2";
function Create(props) {
//   const [loginModalShow, setLoginModalShow] = useState(props.show);
  const [formData, setFormData] = useState({
    fullName: '',
    Email: '',
    Contact:'',
  });
 let handleChange=(event)=>{
  const { name, value } = event.target;
  setFormData({ ...formData, [name]: value });
  console.log(event)
  }
 let UserData = []

 const [data, setData] = useState([]); // Initialize an empty array as state

 // Function to push data into the array
 const pushData = () => {
   const newData = 'New Data'; // Replace 'New Data' with the data you want to push
   setData(prevData => [...prevData, newData]);
 };

let ADDEmployee=(event)=>{
   event.preventDefault();
   const [data, setData] = useState(localStorage.getItem('formData')); 
   
    // const  UserDetails= localStorage.getItem('formData')
    console.log('UserDetails',UserDetails)
    
    //UserData.push(localStorage.setItem('formData', JSON.stringify(formData)))
  Swal.fire({
    title: 'Submited!',
    text: 'You are registered successfully!!',
    icon: 'success',
  });
  UserData= JSON.stringify(formData)
  localStorage.setItem('formData', JSON.stringify(formData))
  setData(UserDetails => [...UserDetails, UserData]);
  setFormData({
    fullName: '',
    Email: '',
    Contact:''
  });
    // navigate('/Manage');
    // <Link to="/Manage" className="nav-link"></Link>
  console.log(formData)
 
  console.log(UserData)
 }
  if (!props.show) return null;
  return (
    <div>
      <div
        className="modal fade"
        id="modal-default"
        show={props.show}
        // closeButton={setLoginModalShow}
      >
        <div className="modal-dialog">
          <div className="modal-content">
            <div className="modal-header">
              <h4 className="modal-title">Employee</h4>
              <button
                type="button"
                className="close"
                data-dismiss="modal"
                aria-label="Close"
              >
                <span aria-hidden="true">×</span>
              </button>
            </div>
            <div className="modal-body">
              <form onSubmit={ADDEmployee}>
                <div className="card-body">
                  <div className="form-group">
                    <label htmlFor="exampleInputEmail1">Full Name</label>
                    <input
                      type="text"
                      className="form-control"
                      id="exampleInputEmail1"
                      name="fullName"
                      placeholder="Enter Full Name"
                      value={formData.fullName} onChange={handleChange }
                    />
                  </div>
                  <div className="form-group">
                    <label htmlFor="exampleInputPassword1">Email</label>
                    <input
                      type="email"
                      className="form-control"
                      id="exampleInputPassword1"
                      name="Email"
                      placeholder="Enter Email"
                      value={formData.Email} onChange={handleChange }
                    />
                  </div>  
                   <div className="form-group">
                    <label htmlFor="exampleInputPassword1">Contact No.</label>
                    <input
                      type="number"
                      className="form-control"
                      id="exampleInputPassword1"
                      name="Contact"
                      placeholder="Enter Contact Number"
                      value={formData.Contact} onChange={handleChange }
                    />
                  </div>
                  <div className="form-check">
                    <input
                      type="checkbox"
                      className="form-check-input"
                      id="exampleCheck1"
                    />
                    <label className="form-check-label" htmlFor="exampleCheck1">
                     IsAdmin
                    </label>
                  </div>
                </div>

                <div className="modal-footer justify-content-between" >
                <button
                type="button"
                className="btn btn-default"
                data-dismiss="modal"
              >
                Close
              </button>
              <button type="submit" className="btn btn-primary">
                Save changes
              </button>
                </div>
              </form>
            </div>
           
          </div>
          {/* /.modal-content */}
        </div>
        {/* /.modal-dialog */}
      </div>
    </div>
  );
}

export default Create;
